                          <section class="secure-sanctum-s">
                            <div class="container">
                                       <h1>
                                         COOKIE-NUTZUNG
                                       </h1>
                                       <p>
                                         Unsere Website verwendet Cookies, wie fast alle Websites dies tun, um Ihnen die bestmögliche Erfahrung zu bieten. Cookies sind kleine Textdateien, die auf Ihrem Computer oder
                                         Mobiltelefon platziert werden, wenn Sie Websites durchsuchen.
                                       </p>
                                       <h3>
                                         Cookies: Ihre Typen und unsere Gründe für ihre Verwendung
                                       </h3>
                                       <p>
                                         <strong>Session-Cookies</strong>
                                       </p>
                                       <p>
                                         Die Unternehmenswebsite setzt hauptsächlich Session-Cookies ein. Session-Cookies ermöglichen es Websites, Informationen von Seite zu Seite zu speichern, sodass der Benutzer diese
                                         Informationen nicht mehrfach eingeben muss. Das Hauptbeispiel für die Verwendung von Session-Cookies ist beim Kauf in einem Internetshop – ein Session-Cookie würde verwendet, um zu
                                         merken, was der Benutzer in seinen Warenkorb gelegt hat, damit dies bis zum Checkout durchgeführt wird.
                                       </p>
                                       <p>
                                         Session-Cookies werden normalerweise von Ihrem Browser gelöscht, wenn der Browser geschlossen wird.
                                       </p>
                                       <p>
                                         <strong>Analytische Cookies</strong>
                                       </p>
                                       <p>
                                         Teile dieser Website verwenden einen Drittanbieter-Analysedienst (siehe Abschnitt zwei der Datenschutz- und Cookie-Richtlinie), der ebenfalls Cookies auf Ihrem Computer platziert. Die
                                         durch diese Cookies gesammelten Informationen über Ihre Nutzung dieser Website werden an sie übermittelt und dort gespeichert.
                                       </p>
                                       <p>
                                         Das Unternehmen verwendet die statistischen Analysewerkzeuge nicht, um das persönlich identifizierbare Verhalten von Besuchern dieser Website zu verfolgen oder zu sammeln. Das
                                         Unternehmen wird keine Daten, die gesammelt werden, mit persönlich identifizierbaren Informationen aus irgendeiner Quelle verknüpfen, als Teil unserer Nutzung der statistischen
                                         Analysewerkzeuge.
                                       </p>
                                       <p>
                                         <strong>Drittanbieter-Analysedienst</strong>
                                       </p>
                                       <p>
                                         Wir verwenden Cookies des Analysedienstes, um Informationen über Ihren Besuch auf unserer Seite zu speichern. Dies hilft uns, die Nutzung und Beliebtheit unserer Dienste besser zu
                                         verstehen und wie erfolgreich die Website funktioniert.
                                       </p>
                                       <p>
                                         Wenn Sie dies nicht wünschen, können Sie sich vom Analysedienst abmelden, indem Sie eine Erweiterung für Ihren Browser installieren. Alternativ können Sie die Cookies wie bei jedem
                                         anderen Cookie löschen oder einschränken.
                                       </p>
                                       <p>
                                         <strong>Hotjar-Analytik</strong>
                                       </p>
                                       <p>
                                         Drittanbieter verwenden Cookies, um Anzeigen basierend auf früheren Besuchen dieser Website zu schalten. Dies ermöglicht es uns, Personen zu erreichen, die die Unternehmenswebsite zuvor
                                         besucht haben, und die richtigen Personen mit der richtigen Nachricht zu verbinden. Remarketing-Cookies verfallen zwei Jahre nach dem Setzen oder Aktualisieren (je nachdem, was später
                                         eintritt).
                                       </p>
                                       <p>
                                         Alle gesammelten Daten werden gemäß unserer eigenen Datenschutzrichtlinie verwendet.
                                       </p>
                                       <h3>
                                         Cookies und Tracking-Mechanismen von Drittanbietern
                                       </h3>
                                       <p>
                                         Umgang mit Drittanbieter-Cookies: Unsere Website nutzt Cookies von Drittanbieter-Entitäten, wie Werbenetzwerken und Analysediensten. Diese Cookies liegen außerhalb unserer Kontrolle,
                                         umfassen jedoch typischerweise analytische, leistungsbezogene und zielgerichtete Cookies. Sie können diese Cookies über die Cookie-Einstellungen Ihres Browsers verwalten, aber das
                                         Blockieren bestimmter Arten (insbesondere wesentlicher Cookies) kann Ihre Fähigkeit beeinträchtigen, die vollen Funktionen unserer Website zu nutzen.
                                       </p>
                                       <h3>
                                         Alternative Tracking-Techniken
                                       </h3>
                                       <p>
                                         <strong>Verwendung von Web Beacons in unseren digitalen Systemen</strong>
                                       </p>
                                       <p>
                                         Bestimmte Bereiche unseres digitalen Systems verwenden Web Beacons, um Benutzerbesuche und -aktivitäten zu verfolgen. Diese Technologie hilft uns und unseren Partnern, das
                                         Nutzerverhalten zu verstehen und die Dienstleistung zu verbessern.
                                       </p>
                                       <h3>
                                         Fortschrittliche Cookie-Verwaltung
                                       </h3>
                                       <p>
                                         Passe deine Cookie-Einstellungen jederzeit an: Greife auf den Abschnitt "Verwalte deine Cookies" am unteren Ende der Seite zu, um Anweisungen zur Änderung deiner Einstellungen zu
                                         erhalten.
                                       </p>
                                       <h3>
                                         Andere Bestimmungen
                                       </h3>
                                       <p>
                                         <strong>Verfolgung der E-Mail-Interaktion</strong>
                                       </p>
                                       <p>
                                         Unsere E-Mails können ein "Web Beacon Pixel" enthalten, das uns anzeigt, ob und wann die E-Mail geöffnet wurde, sowie Klicks auf Links innerhalb der E-Mail verfolgt. Diese Daten helfen
                                         uns zu bewerten, welche E-Mails am interessantesten sind. Sie können diese Verfolgung vermeiden, indem Sie E-Mails im Nur-Text-Format lesen oder Bilder deaktivieren.
                                       </p>
                            </div>
